public class StarDTO {    private Integer starId;    private String fullName;    private Integer numberStar;    private String productName;    private Boolean starStatus;    private Integer orderId;    private Integer productId;    private Integer userId;    public Integer getStarId() {        return this.starId;    }    public void setStarId(Integer starId) {        this.starId = starId;    }    public String getFullName() {        return this.fullName;    }    public void setFullName(String fullName) {        this.fullName = fullName;    }    public Integer getNumberStar() {        return this.numberStar;    }    public void setNumberStar(Integer numberStar) {        this.numberStar = numberStar;    }    public String getProductName() {        return this.productName;    }    public void setProductName(String productName) {        this.productName = productName;    }    public Boolean getStarStatus() {        return this.starStatus;    }    public void setStarStatus(Boolean starStatus) {        this.starStatus = starStatus;    }    public Integer getOrderId() {        return this.orderId;    }    public void setOrderId(Integer orderId) {        this.orderId = orderId;    }    public Integer getProductId() {        return this.productId;    }    public void setProductId(Integer productId) {        this.productId = productId;    }    public Integer getUserId() {        return this.userId;    }    public void setUserId(Integer userId) {        this.userId = userId;    }}